INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSM', 'STOCK', 'BNY Mellon Strategic Municipal Bond Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'BNY Mellon Strategic Municipal Bond Fund, Inc. is a closed ended fixed income mutual fund launched and managed by BNY Mellon Investment Adviser, Inc. The fund invests in the fixed income markets of the United States. It primarily invests in investment grade municipal bonds which are exempt from federal income tax. The fund seeks to maintain a weighted average maturity of greater than 10 years. It was formerly known as Dreyfus Strategic Municipal Bond Fund, Inc. BNY Mellon Strategic Municipal Bond Fund, Inc. was formed on November 22, 1989 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHEK', 'STOCK', 'Check-Cap Ltd.', 'NCM', 'Healthcare', 'Diagnostics & Research', 'Check Cap Ltd is an Israel-based clinical-stage medical diagnostics company. Check Cap Ltd develops C-Scan, patient-friendly preparation-free test designed to detect polyps before they may transform into cancer to enable early intervention and cancer prevention. It''s capsule-based screening technology aims to increase screening adherence worldwide. The system utilizes ultra-low-dose X- rays to scan the inner lining of the colon for precancerous polyps, and other structural abnormalities. C-Scan is non-invasive capsule that is propelled through the gastrointestinal tract by natural motility. C-Scan is comprised of three main components: C-Scan Cap, an ingestible X-ray scanning capsule; C-Scan Track, three miniaturized patches worn on the patients back for integrated positioning, control and data recording; and C-Scan View, a proprietary software to process and represent 2D and 3D maps of the inner surface of the colon.', 'Isfiya, , Israel', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ORRF', 'STOCK', 'Orrstown Financial Services, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Orrstown Financial Services, Inc. is a financial holding company for its wholly owned subsidiary Orrstown Bank (the Bank). The Bank provides a range of consumer and business financial services in Berks, Cumberland, Dauphin, Franklin, Lancaster, Perry, and York Counties, Pennsylvania and Anne Arundel, Baltimore, Harford, Howard, and Washington Counties, Maryland, as well as Baltimore City, Maryland. The Bank operates in the community banking segment and engages in lending activities, including commercial, residential, commercial mortgages, construction, municipal, and various forms of consumer lending and deposit services, including checking, savings, time and money market deposits. The Company''s lending area also includes adjacent counties in Pennsylvania and Maryland, as well as Loudon County, Virginia and Berkeley, Jefferson and Morgan Counties, West Virginia. The Bank also provides fiduciary, investment advisory, insurance and brokerage services.', 'Harrisburg, PA, United States', 607);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FEGE', 'STOCK', 'First Eagle Global Equity ETF', 'NYQ', NULL, NULL, 'The fund is an actively managed exchange-traded fund (“ETF”) and seeks to achieve its objective by investing, under normal conditions, at least 80% of its net assets (plus any borrowings for investment purposes) in equity and equity-related securities issued by U.S. and non-U.S. issuers.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECO', 'STOCK', 'Okeanis Eco Tankers Corp.', 'NYQ', 'Industrials', 'Marine Shipping', 'Okeanis Eco Tankers Corp is a Greece-based company primarily engaged in the maritime industry. The Company focuses on deep sea freight transportation, as it is charters and operates tanker vessels for transporting crude oil. The Company, through its subsidiaries, owns a fleet of various modern ECO-standard vessels that consume less bunker fuel, equipped with exhaust gas cleaning systems (scrubbers), and comply with ballast water treatment regulations. The fleet consists of multiple Suezmax and several VLCC vessels. The Company, through its customer network, retains an international presence in countries such as Singapore, the United Kingdom, Hong Kong, Switzerland, Turkey and Brazil, as well as the United States among others.', 'Neo Faliro, , Greece', 13);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXOD', 'STOCK', 'Exodus Movement, Inc.', 'ASE', 'Technology', 'Software - Infrastructure', 'Exodus Movement, Inc. is a financial technology company empowering individuals and businesses with secure crypto software solutions. The Company is engaged in the business of creating and distributing self-custodial wallets for digital assets. With self-custodial wallets, the Company puts customers in full control of their funds, enabling them to swap, buy, and sell crypto. Its products include Web3 Wallet, Mobile Wallet, Desktop Wallet, Ledger Hardware Wallet, Trezor Hardware Wallet, Earn Crypto Rewards, XO Swap, Passkeys Wallet & SDK, and Wallet-as-a-Service. XO Swap is a premium swap engine that can be integrated into its clients product to enable more swap pairs for its customers specifically from BTC to other tokens. Web3 Wallet features include connect to web3 dapps, one home for its customers NFTs, and swap cross-chain. Its customers can manage and swap their cryptocurrencies in Exodus securely from their Trezor. It offers one-click Web3 onboarding with Passkeys Developer kit.', 'Omaha, NE, United States', 210);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SMP', 'STOCK', 'Standard Motor Products, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'Standard Motor Products, Inc. is a manufacturer and distributor of replacement parts in the automotive aftermarket and a custom-engineered solutions provider to vehicle and equipment manufacturers in diverse non-aftermarket end markets. The Companys Vehicle Control Segment services its core automotive aftermarket customers through its offering of replacement parts within the product groups: Engine Management, Electrical and Safety and Wire Sets and Other. Its Temperature Control Segment also services its core automotive aftermarket customers through its offering of replacement parts within the various product groups: AC System Components and Other Thermal Components. The Companys Engineered Solutions Segment services its vehicle and equipment manufacturing customers across diverse global end markets, including on-highway and off-highway applications such as commercial and light vehicles, construction, agriculture, power sports, marine, hydraulics and lawn and garden.', 'Long Island City, NY, United States', 5600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPF', 'STOCK', 'Central Pacific Financial Corp.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Central Pacific Financial Corp. is the bank holding company of Central Pacific Bank (the Bank). The Bank is engaged in offering traditional deposit and lending products and services to consumer and business customers, such as accepting demand, money market, savings and time deposits, originating loans, including commercial loans, construction loans, commercial real estate loans, residential mortgage loans, and consumer loans and fiduciary and investment management services. Its investment securities portfolio includes mortgage-backed securities (MBS), other debt securities and equity securities. Its MBS portfolio comprises residential MBS issued by United States government entities and agencies. It offers wealth management products and services, such as non-deposit investment products, annuities, investment management, asset custody and general consultation and planning services. It has approximately 27 bank branches and 55 ATMs located throughout the State of Hawaii.', 'Honolulu, HI, United States', 697);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSW', 'STOCK', 'CSW Industrials, Inc.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'CSW Industrials, Inc. provides various industrial products in the United States and internationally. It operates through three segments: Contractor Solutions, Engineered Building Solutions, and Specialized Reliability Solutions. The Contractor Solutions segment offers condensate pads, pans, and pumps; condensate switches and traps; drain management system; drain waste and vent mechanical products; ductless mini-split systems installation support tools and accessories; HVAC electrical protection, installation supplies, and maintenance chemicals; evaporator coils and air handlers; grilles, registers, diffusers and vents; line set covers; load management systems; refrigerant caps; solvents, cements, traps, and thread sealants; surge protection products; and wire pulling head tools. This segment sells its products under the AquaGuard, Aspen, Clean Check, Cover Guard, Desolv, Dust Free, EZ Trap, Falcon Stainless, Fortress, Goliath, G-O-N, Guardian Drain Lock, Hubsett, Kickstart, Leak Freeze', 'Dallas, TX, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSGN', 'STOCK', 'Design Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Design Therapeutics, Inc. is a biotechnology company. It is engaged in the research and development of GeneTACT molecules, which are small-molecule gene targeted chimera therapeutic candidates designed to be disease-modifying by addressing the underlying cause of diseases caused by inherited nucleotide repeat expansion mutations. Its Friedreich ataxia (FA) program is focused on the development of a disease-modifying treatment. Its DT-216 is developed to overcome the FXN transcription impairment that causes FA. DT-216 is in Phase I clinical trial. It is also engaged in developing DT-216 to enable higher exposure and chronic administration for treatment of FA, known as DT-216P2, which uses the same drug substance, DT-216. Its FECD program is focused on the development of a potentially disease-modifying medical treatment for FECD, DT-168, which is in Phase I clinical trial. Its Huntington''s Disease program is focused on the development of a potentially disease-modifying treatment for HD.', 'Carlsbad, CA, United States', 57);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYM', 'STOCK', 'BlackRock Municipal Income Quality Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Municipal Income Quality Trust is a closed-ended fixed income mutual fund launched by BlackRock, Inc. It is managed by BlackRock Advisors, LLC. The fund invests in the fixed income markets of the United States. It primarily invests in investment grade municipal bonds exempt from federal income taxes, including the alternative minimum tax. BlackRock Municipal Income Quality Trust was formed on October 31, 2002 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMND', 'STOCK', 'Clearmind Medicine Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Clearmind Medicine Inc. is a psychedelic pharmaceutical biotech company. The Company is focused on the discovery and development of novel psychedelic-derived therapeutics to solve widespread and underserved health problems, including alcohol use disorders. The Company researches and develops psychedelic-based compounds and attempts to commercialize them as regulated medicines, foods, or supplements. The Companys intellectual portfolio consists of 19 patent families including 31 granted patents.', 'Vancouver, BC, Canada', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOGZ', 'STOCK', 'Dogness (International) Corporation', 'NCM', 'Consumer Cyclical', 'Leisure', 'Dogness (International) Corporation is a China-based holding company. The Company is principally engaged in the design and manufacture of pet products. The Companys products include leashes, accessories, collars, harnesses and intelligent smart pet products. Through a single platform, the Dogness mobile app, the Companys smart products allow pet owners to remotely see, hear, speak, feed, play, and interact with their pets in different ways.', 'Dongguan, , China', 197);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARTL', 'STOCK', 'Artelo Biosciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Artelo Biosciences, Inc. is a clinical-stage pharmaceutical company dedicated to the development and commercialization of therapeutics that modulate lipid-signaling pathways. The Company is advancing a portfolio of broadly applicable product candidates designed to address significant unmet needs in multiple diseases and conditions, including anorexia, cancer, anxiety, dermatologic conditions, pain, and inflammation. Its pipeline products include ART26.12, ART27.13 and ART12.11. ART26.12, its Fatty Acid Binding Protein 5 (FABP5) inhibitor, is being developed as a novel, peripherally acting, non-opioid, non-steroidal analgesic. The Cancer Appetite Recovery Study (CAReS) is a Phase 1/2 randomized, placebo-controlled trial of its clinical program, ART27.13, in patients with cancer anorexia and weight loss. ART12.11, the Company''s novel solid-state cannabidiol composition co-formed with tetramethylpyrazine, is targeted for development in anxiety disorders and rare/orphan diseases.', 'Solana Beach, CA, United States', 6);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('PAVM', 'STOCK', 'PAVmed Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'PAVmed Inc. is a multi-product, commercial-stage medical technology company. The Company operates in the medical devices, diagnostics, and digital health sectors. Its subsidiary includes Lucid Diagnostics Inc., which is a commercial-stage cancer prevention medical diagnostics company that markets the EsoGuard Esophageal DNA Test and EsoCheck Esophageal Cell Collection Device for early detection of esophageal precancer to prevent esophageal cancer deaths. EsoCheck is a noninvasive swallowable balloon capsule catheter device capable of sampling surface esophageal cells. EsoGuard is a bisulfite-converted next-generation sequencing (NGS) DNA assay performed on surface esophageal cells collected with EsoCheck. Its other subsidiary, Veris Health Inc., is a digital health company focused on enhanced personalized cancer care through remote patient monitoring using implantable biologic sensors with wireless communication along with a custom suite of connected external devices.', 'New York, NY, United States', 39);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNR', 'STOCK', 'Burning Rock Biotech Limited', 'NGM', 'Healthcare', 'Diagnostics & Research', 'Burning Rock Biotech Ltd is a Company principally engaged in developing and providing cancer therapy selection tests. The Company operates three businesses, including central laboratory business, in-hospital business and pharma research and development services. Central laboratory business mainly includes the sales of its cancer therapy selection test to individual patient customers. In-hospital business includes the manufacture and sales of reagent kits, as well as the provision of facilitation services for laboratory equipment sold to hospitals. The pharma research and development services include a range of cancer therapy selection test services, analytical validation services and project management services.', 'Guangzhou, , China', 674);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DBD', 'STOCK', 'Diebold Nixdorf, Incorporated', 'NYQ', 'Technology', 'Software - Application', 'Diebold Nixdorf, Incorporated automates, digitizes and transforms the way people bank and shop. The Company is engaged in providing hardware, software, and services to global blue-chip banking and retail clients. The Companys segments include Banking and Retail. Its Banking segment offers services, such as the operation of integrated core components to maximize security and drive efficient operations for monitoring and cash management; implementation services; maintenance and availability services; managed services; cash and branch automation services; its AllConnect Data Engine, which provides data-driven intelligence; and its Transaction Middleware, which is an adaptable cloud-native transaction processing platform. Its retail product portfolio includes both modular and integrated, all-in-one POS as well as self-service solutions, such as SCO and self-service kiosks that address changing consumer shopping journeys, as well as retailers and store staffs automation requirements.', 'North Canton, OH, United States', 21000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTIL', 'STOCK', 'Precision BioSciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Precision BioSciences, Inc. is a clinical-stage gene editing company dedicated to improving life (DTIL) with its proprietary ARCUS genome editing platform. Using ARCUS, the Companys pipeline is comprised of in vivo gene editing candidates designed to deliver cures for a range of genetic and infectious diseases. The ARCUS platform is used to develop in vivo gene editing therapies for gene edits, including gene insertion, elimination, and excision. The Company''s in vivo gene editing pipeline programs include PBGENE-HBV, PBGENE-3243, PBGENE-DMD, PBGENE-LIVER, PBGENE-CNS, PBGENE-NVS and iECURE-OTC. PBGENE-HBV is its lead in vivo gene editing program designed to eliminate cccDNA, the key source of replicating hepatitis B virus (HBV) and inactivating integrated HBV DNA in hepatocytes. Its PBGENE-3243 program is a first of its kind potential treatment for m.3243 associated mitochondrial disease. The Company''s iECURE-OTC program is developed in partnership with iECURE, Inc.', 'Durham, NC, United States', 102);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHCO', 'STOCK', 'City Holding Company', 'NMS', 'Financial Services', 'Banks - Regional', 'City Holding Company is a financial holding company. The Company conducts its activities through its wholly owned subsidiary, City National Bank of West Virginia (City National). City National provides banking, trust and investment management and other financial solutions through its network of approximately 97 bank branches located in West Virginia, Kentucky, Virginia and southeastern Ohio. City National offers a full range of commercial banking services to corporations and other business customers. Loans are provided for a variety of business purposes, including financing for commercial and industrial projects, income producing commercial real estate, owner-occupied real estate and construction and land development. City National provides banking services to consumers, including checking, savings and money market accounts as well as certificates of deposit and individual retirement accounts. City National also offers credit cards through an agreement with a third-party vendor.', 'Charleston, WV, United States', 934);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLIR', 'STOCK', 'ClearSign Technologies Corporation', 'NCM', 'Industrials', 'Pollution & Treatment Controls', 'ClearSign Technologies Corporation designs and develops products and technologies for the purpose of decarbonization and improving key performance characteristics of industrial and commercial systems, including operational performance, energy efficiency, emission reduction, safety, and overall cost-effectiveness. The Companys patented technologies are designed to be embedded in established original equipment manufacturers (OEM) products as ClearSign Core and ClearSign Eye and other sensing configurations in order to enhance the performance of combustion systems and fuel safety systems in a broad range of markets. These markets include energy (upstream oil production and down-stream refining), commercial/industrial boiler, chemical, petrochemical, transport and power industries. The Companys products include process burners, midstream and power, boiler burners, and flares.', 'Tulsa, OK, United States', 16);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMBT', 'STOCK', 'Cmb.Tech NV', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Euronav NV (Euronav) is a Belgium-based company engaged in the transportation and storage of crude oil and petroleum products. The Company provides shipping services, in addition to the carriage of crude oil on its fleet of tankers. The Company, along with its group entities, operates in two business segments: the operation of crude oil tankers on the international markets (tankers), and the floating production, storage, and offloading operations. The Companys ship management services include, among others, technical services, fleet personnel management, environmental, protection management system, commercial management, and operational management. Its group companies include Euronav Ship Management SAS, Euronav Shipping NV, Euronav Tankers NV, Euronav SAS, Euronav UK Ltd., Euronav Hong Kong Ltd., and Great Hope Enterprises Ltd.', 'Antwerp, , Belgium', 2752);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LSH', 'STOCK', 'Lakeside Holding Limited', 'NCM', 'Industrials', 'Integrated Freight & Logistics', 'Lakeside Holding Limited is an integrated cross-border supply chain solution provider with a strategic focus on the Asian market, including China and South Korea. The Company primarily provides customized cross-border ocean freight solutions and airfreight solutions in the United States that specifically cater to its customer''s requirements and needs in transporting goods into the United States. It offers a variety of integrated services under its cross-border ocean freight solutions and cross-border airfreight solutions, including cross-border freight consolidation and forwarding services, customs clearance services, warehousing and distribution services and United States domestic ground transportation services. It operates two regional warehousing and distribution centers in the United States, in Illinois and Texas. The Companys customers are typically Asia and United States-based logistics service companies serving e-commerce platforms, social commerce platforms, and others.', 'Itasca, IL, United States', 50);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('YCBD', 'STOCK', 'cbdMD, Inc.', 'ASE', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'cbdMD, Inc. is a cannabidiol (CBD) company. The Company has a comprehensive line of United States produced, THC-free CBD products, including NSF Certified for Sport products, as well as its new Full Spectrum products. The Company''s flagship brands include cbdMD and Paw CBD, as well as its functional mushroom brand ATRx Labs. Its cbdMD brand includes high-grade, premium CBD products including CBD tinctures, CBD gummies, CBD topicals, CBD capsules, CBD sleep aids and CBD drink products including its Herbal Oasis Social Tonic and an array of Farm Act compliant Delta 9 products. Its Paw CBD brand of pet products includes veterinarian-formulated products including tinctures, chews, topicals products in varying strengths, and its ATRx brand of natural functional mushroom support. Its cbdMD, Paw CBD and ATRx products are distributed through its e-commerce websites, third party e-commerce sites, select distributors and marketing partners as well as a variety of brick-and-mortar retailers.', 'Charlotte, NC, United States', 42);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('UHT', 'STOCK', 'Universal Health Realty Income Trust', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'Universal Health Realty Income Trust is a real estate investment trust. The Company invests in healthcare and human service related facilities, including acute care hospitals, behavioral healthcare hospitals, specialty facilities, free-standing emergency departments, childcare centers and medical/office buildings. The Company has approximately 76 real estate investments or commitments located in 21 states in the United States consisting of six hospital facilities including three acute care and three behavioral healthcare; 60 medical/office buildings; four free-standing emergency departments; four preschool and childcare centers; one specialty facility located in Evansville, Indiana, and one property comprised of vacant land located in Chicago, Illinois. Its facilities include McAllen Medical Center, Wellington Regional Medical Center, Aiken Regional Medical Center, Canyon Creek Behavioral Health, Clive Behavioral Health, Desert Valley Medical Center and Danbury Medical Plaza.', 'King of Prussia, PA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMG', 'STOCK', 'Affiliated Managers Group, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Affiliated Managers Group, Inc. is a global independent investment management company. The Company is focused on investing in a range of partner-owned investment firms, known as Affiliates. Its Affiliates provide a diverse range of differentiated investment strategies designed to assist institutional and wealth clients worldwide in achieving their investment objectives. Its Affiliates also provide investment management and customized investment counseling and fiduciary services to high-net worth individuals and families and institutional clients. It manages its assets across a range of private markets, liquid alternative and differentiated long-only investment strategies. The Companys Affiliates operate in a diverse number of areas with long-term structural tailwinds, including infrastructure, credit, private market solutions, and specialty areas including industrial decarbonization, life sciences, and multifamily real estate.', 'West Palm Beach, FL, United States', 4100);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARQ', 'STOCK', 'Arq, Inc.', 'NGM', 'Industrials', 'Pollution & Treatment Controls', 'Arq, Inc. is a diversified environmental technology. The Company is a vertically integrated producer of activated carbon products in North America. It is engaged in the sale of consumable air, water, and soil treatment solutions, primarily based on activated carbon (AC). It manufactures and sells AC and other chemicals used to capture and remove impurities, contaminants and pollutants for the coal-fired power generation, industrial, water treatment, and water and soil remediation markets, which it collectively refers to as the advanced purification technologies (APT) market. Its AC products include both powdered activated carbon and granular activated carbon. It also owns the Five Forks Mine, a lignite coal mine that supplies the primary raw material for the manufacturing of its products. Its products are used to purify contaminated liquid, soil, and gas streams from a variety of industrial sources, including wastewater treatment plants, coal-fired power plants and other end markets.', 'Greenwood Village, CO, United States', 200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLLL', 'STOCK', 'GraniteShares 2x Long DELL Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change the underlying stock by entering into financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIOX', 'STOCK', 'Bioceres Crop Solutions Corp.', 'NMS', 'Basic Materials', 'Agricultural Inputs', 'Bioceres Crop Solutions Corp. is a provider of crop productivity technologies designed to enable the transition of agriculture towards carbon neutrality. Its segments include Seed and integrated products, Crop protection and Crop nutrition. Seed and integrated products segment focuses on the development and commercialization of seed technologies and products, including provision of seed technologies integrated with crop protection and crop nutrition products designed to control weeds, insects or diseases, to increase their quality characteristics. Crop protection segment includes the development, production and marketing of adjuvants and a range of pest control molecules and biocontrol products. Crop nutrition segment focuses on the development, production and commercialization of inoculants that allow the biological fixation of nitrogen in the crops, and of fertilizers, including biofertilizers and micro-granulated fertilizers that optimize the productivity and yield of the crops.', 'Rosario, , Argentina', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COEP', 'STOCK', 'Coeptis Therapeutics Holdings, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Coeptis Therapeutics Holdings, Inc. is a biopharmaceutical and technology company. The Company is focused on developing cell therapy platforms for cancer, autoimmune, and infectious diseases. Its product portfolio is highlighted by assets licensed from Deverra Therapeutics, including an allogeneic cellular immunotherapy platform and DVX201, a clinical-stage, unmodified natural killer cell therapy technology. It is developing a universal, multi-antigen CAR technology licensed by the University of Pittsburgh (SNAP-CAR), and the GEAR cell therapy and companion diagnostic platforms in collaboration with VyGen-Bio and medical researchers at the Karolinska Institute. Its NexGenAI Affiliates Network platform offers AI-powered marketing software and robotic process automation capabilities. The Companys subsidiaries include Coeptis Therapeutics, Inc., Coeptis Pharmaceuticals, Inc., GEAR Therapeutics, Inc. and SNAP Biosciences, Inc.', 'Wexford, PA, United States', 5);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCIX', 'STOCK', 'Churchill Capital Corp IX', 'NGM', 'Financial Services', 'Shell Companies', 'Churchill Capital Corp IX is a blank check company. The Company is formed for the purpose of effecting a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. The Company has no operations and has not generated any revenues.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLNN', 'STOCK', 'Clene Inc.', 'NCM', 'Consumer Defensive', 'Packaged Foods', 'Clene Inc. is a late clinical-stage biopharmaceutical company focused on improving mitochondrial health and protecting neuronal function to treat neurodegenerative diseases, including amyotrophic lateral sclerosis, Parkinson''s disease, and multiple sclerosis. It specializes in the discovery, development, and commercialization of clean-surfaced nanotechnology (CSN) therapeutics. CNM-Au8, the lead asset, is a concentrated aqueous suspension of catalytically active, clean-surfaced, faceted gold nanocrystals. CNM-Au8s mechanism of action targets mitochondrial dysfunction by catalyzing the production of nicotinamide adenine dinucleotide. Its CNM-ZnAg is a broad-spectrum antiviral, antibacterial agent comprised of zinc (Zn2+) and silver (Ag+) ions under development to treat infectious disease and to provide immune support for symptom resolution. Its CNM-AgZn17 is a gel polymer suspension of Zn2+ and Ag+ under development for the treatment of infectious diseases and to support wound healing', 'Salt Lake City, UT, United States', 75);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMO', 'STOCK', 'Western Asset Mortgage Opportunity Fund Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Western Asset Mortgage Opportunity Fund Inc. is a closed ended fixed income mutual fund launched and managed by Legg Mason Partners Fund Advisor, LLC. The fund is co-managed Western Asset Management Company and Western Asset Management Company Limited. It invests in the fixed income markets of the United States. The fund invests primarily in mortgage-backed securities. It employs intensive proprietary research to create its portfolio. The fund benchmarks the performance of its portfolio against the BofA Merrill Lynch U.S. Floating Rate Home Equity Loan Asset Backed Securities Index. Western Asset Mortgage Opportunity Fund Inc. was formed on December 11, 2009 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GABC', 'STOCK', 'German American Bancorp, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'German American Bancorp, Inc. is a financial holding company. The Company, through its banking subsidiary German American Bank, operates around 94 banking offices located throughout Indiana (central/southern), Kentucky (northern/central/western), and Ohio (central/ southwest). In Columbus, Ohio and Greater Cincinnati, the Company does business as Heartland Bank. Its segments include core banking, wealth management services, and insurance operations. The core banking segment involves deposits from the public and using such funds to originate consumer, commercial and agricultural, commercial and agricultural real estate, and residential mortgage loans. The wealth management segments revenues are composed primarily of fees generated by the wealth advisory and trust operations. The insurance segment offers a range of personal and corporate property and casualty insurance products. The Company also owns an investment brokerage subsidiary, German American Investment Services, Inc.', 'Jasper, IN, United States', 1020);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRN', 'STOCK', 'Barnwell Industries, Inc.', 'ASE', 'Energy', 'Oil & Gas E&P', 'Barnwell Industries, Inc. and its subsidiaries are principally engaged in oil and natural gas and land investment activities. The Companys oil and natural gas segment is engaged in acquiring, developing, producing and selling oil and natural gas in Canada and the United States. Its land investment segment is engaged in leasehold land interests in Hawaii. In addition, the Company, through its wholly owned subsidiaries, involved in several non-operated oil and natural gas investments in Oklahoma and Texas. The Companys core Canadian asset is located at Twining, Alberta, about 70 miles northeast of Calgary and encompasses 16,000 net acres. Its subsidiary, BOK Drilling, LLC, has a minority non-operated interest in seven wells in Oklahoma. Its subsidiary, Barnwell Texas, LLC, has a minority non-operated interest in two wells in Texas.', 'Honolulu, HI, United States', 27);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CERO', 'STOCK', 'CERo Therapeutics Holdings, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'CERo Therapeutics Holdings, Inc. is an immunotherapy company advancing the development of engineered T cell therapeutics for the treatment of cancer. Its proprietary approach to T cell engineering, which enables it to integrate certain desirable characteristics of both innate and adaptive immunity into a single therapeutic construct, is designed to engage the bodys full immune repertoire to achieve optimized cancer therapy. This novel cellular immunotherapy platform is designed to redirect patient-derived T cells to eliminate tumors by building in engulfment pathways that employ phagocytic mechanisms to destroy cancer cells, creating what the Company refers to as Chimeric Engulfment Receptor T cells (CER-T). Its lead molecule is CER-1236, an autologous T-cell product that targets a novel tumor antigen, TIM-4 ligand. The Company is initiating clinical trials for its lead product candidate, CER-1236, for hematological malignancies.', 'South San Francisco, CA, United States', 8);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRMT', 'STOCK', 'America''s Car-Mart, Inc.', 'NMS', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Americas Car-Mart, Inc. is an automotive retailer in the United States focused on the Integrated Auto Sales and Finance segment of the used car market. The Company''s operations are principally conducted through its two operating subsidiaries, Americas Car Mart, Inc., an Arkansas corporation (Car-Mart of Arkansas), and Colonial Auto Finance, Inc., an Arkansas corporation (Colonial). The Company primarily sells older model used vehicles and provides financing for substantially all of its customers. The Companys dealerships operate on a decentralized basis. It operates approximately 154 dealerships in 12 states, located primarily in small cities throughout the South-Central United States. It is an option for those who may not qualify for traditional used car financing because of bad credit, no credit, repossession or past bankruptcy. Its products include peace of mind, service contract plus, pay your way, financing options, flexible trade-in, hand selected vehicles and sell-a-friend.', 'Rogers, AR, United States', 2300);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABTS', 'STOCK', 'Abits Group Inc.', 'NCM', 'Financial Services', 'Capital Markets', 'Abits Group Inc is a company principally engaged in the bitcoin mining and other business.', 'Causeway Bay, , Hong Kong', 11);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DPG', 'STOCK', 'Duff & Phelps Utility and Infrastructure Fund Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Duff & Phelps Utility and Infrastructure Fund Inc is a closed-ended equity mutual fund launched by Virtus Investment Partners, Inc. The fund is managed by Duff & Phelps Investment Management Co. It invests in the public equity markets across the globe. The fund seeks to invest in the companies operating in utility sector. It invests in stocks of companies across diversified market capitalizations. The fund was formerly known as Duff & Phelps Global Utility Income Fund Inc. Duff & Phelps Utility and Infrastructure Fund Inc. was formed on July 29, 2011 and is domiciled in the United States.', 'Chicago, IL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BANF', 'STOCK', 'BancFirst Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'BancFirst Corporation is a financial holding company that operates through its subsidiaries. The Company has six business units: BancFirst metropolitan banks, BancFirst community banks, Pegasus, Worthington, other financial services and executive operations and support. BancFirst metropolitan banks, BancFirst community banks, Pegasus and Worthington offer traditional banking products such as commercial and retail lending and a full line of deposit accounts. BancFirst metropolitan banks banking locations are in the metropolitan Oklahoma City and Tulsa areas. BancFirst community banks banking locations include communities in Oklahoma outside the Oklahoma City and Tulsa metropolitan areas. Pegasuss banking locations include the Dallas metropolitan area. Arlington, Fort Worth and Denton, Texas are banking locations of Worthington. Other financial services are specialty product business units, including small business and residential mortgage lending, and trust services, among others.', 'Oklahoma City, OK, United States', 2135);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIVB', 'STOCK', 'Civista Bancshares, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Civista Bancshares, Inc. is a financial holding company. The Company, through its subsidiary, Civista Bank, is engaged in providing full-service banking, commercial lending, mortgage and wealth management services. Civista Bank, through its locations in Ohio counties of Erie, Crawford, Champaign, Cuyahoga, Franklin, Huron, Logan, Madison, Montgomery, Ottawa, Richland, Henry, Wood and Summit, in the Indiana counties of Dearborn and Ripley and in the Kentucky county of Kenton, conducts a general banking business that involves collecting customer deposits, making loans, purchasing securities, and offering Trust services. It is also engaged in a general equipment leasing and financing business through its Civista Leasing & Financing (CLF) division. Civista Wealth Management division offers investment advisory services to individuals, families, businesses, and non-profits with personalized investment management, 401(k) advisory services for employers, financial planning, and trust services.', 'Sandusky, OH, United States', 526);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMB', 'STOCK', 'BNY Mellon Municipal Bond Infrastructure Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'BNY Mellon Municipal Bond Infrastructure Fund, Inc. is a closed ended fixed income mutual fund launched and managed by BNY Mellon Investment Adviser, Inc. The fund invests in the fixed income markets of the United States. It primarily invests in the tax-exempt investment grade debt obligations issued by or on behalf of states, territories and possessions of the United States and the District of Columbia and their political subdivisions, agencies and instrumentalities, or multistate agencies or authorities, and certain other specified securities. The fund invests its bonds issued by infrastructure sector including transportation, energy and utilities, social infrastructure, water and environment, and other similar public sectors which are rated as BBB- and above by S&P and Fitch and Baa3 and above by Moody''s with an effective duration of up to 14 years.  It employs fundamental and quantitative analysis with a bottom-up security picking approach by focusing on factors such as the relati', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLE', 'STOCK', 'BlackRock Municipal Income Trust II', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Municipal Income Trust II is a closed ended fixed income mutual fund launched by BlackRock, Inc. It is managed by BlackRock Advisors, LLC. The fund invests in fixed income markets. It primarily invests long-term and short-term investments, and money market funds. The fund primarily in investment grade municipal bonds that are exempt from regular federal income tax. BlackRock Municipal Income Trust II was formed on July 30, 2002 and is domiciled in United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUST', 'STOCK', 'Austin Gold Corp.', 'ASE', 'Basic Materials', 'Gold', 'Austin Gold Corp. is a Canada-based gold exploration company. The Company is focused on gold targets and making district-scale gold discoveries in the southwestern United States. The Company has two projects in Nevada and one in Oregon: Kelly Creek, Lone Mountain and Stockade Mountain (Oregon). The Kelly Creek Project is located on the Battle Mountain-Eureka (Cortez) gold trend in Humboldt County and the Lone Mountain Project is on the Independence-Jerritt Canyon gold trend in Elko County. Collectively, these Nevada properties comprise approximately 78.9 square kilometers (km2) of unpatented lode mining claims and private property. In Oregon, the Stockade Mountain Project consists of approximately 21.5 km2 of unpatented mining claims situated in a geological environment that appears the same as the nearby Grassy Mountain Deposit that is being permitted for underground mining. The Company''s subsidiary is Austin American Corporation.', 'Vancouver, BC, Canada', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTSO', 'STOCK', 'Cytosorbents Corporation', 'NCM', 'Healthcare', 'Medical Devices', 'CytoSorbents Corporation is engaged in the treatment of life-threatening conditions in the intensive care unit and cardiac surgery through blood purification. The Companys blood purification technologies are based on biocompatible, highly porous polymer beads that can actively remove toxic substances from blood and other bodily fluids by pore capture and surface adsorption. Its lead product, CytoSorb, is an extracorporeal blood purification cartridge to reduce cytokine storms in common critical illnesses that can lead to massive inflammation, organ failure and patient death. Its products also include ECOS-300CY, VetResQ, DrugSorb-ATR, and PuriFi. DrugSorb-ATR is an investigational device that uses equivalent polymer technology to CytoSorb to address a large unmet need for blood thinner reversal in cardiothoracic surgery. ECOS-300CY is used to reduce cytokines and other inflammatory mediators when used in an ex vivo organ perfusion system.', 'Princeton, NJ, United States', 149);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDC', 'STOCK', 'DDC Enterprise Limited', 'ASE', 'Consumer Defensive', 'Packaged Foods', 'DDC Enterprise Ltd is a holding company principally engaged in the provision of convenient meal solutions. The Company operates its businesses through one segment. The Merchandise segment includes sales of Convenient ready-to-cook (RTC) and ready-to-heat (RTH), Private label products, Advertising services and Experience stores to third parties and individual customers. The Company mainly conducts its businesses in the domestic market and overseas markets.', 'New York, NY, United States', 48);\n
